//const kid_response = document.querySelector("#app")
//const tpl;



export function KidGrid(props) {
    const data = [
        {id:1, nombre:'Juan1'},
        {id:2, nombre:'Juan2'},
        {id:3, nombre:'Juan3'}

    ]
    const [kids, setKids] = useState()

    useEffect(() => {
        setKids(data)
    }, [])

    return (
        <ul>
            {   !kids ? 'cargando...' :
                kids.map( (kid,index) => {
                    return <li> kid: {kid.name} </li>
             })
            }
        </ul>       
    );
}



